import React, { useState } from 'react'
import MainPage from './components/MainPage'
import ItemsShow from './components/ItemShow'
import Login from './components/Login';
import { Routes, Route } from "react-router-dom";
import Signup from './components/Signup';


function App() {

  const [cat,setcat]=useState("")
  const filteritem=(cate)=>{
    setcat(cate);
  }

  return (
    <>

        <Routes>
          <Route path="/" element={<MainPage filteritem={filteritem} />} />

          <Route path="women" key={'women'} element={<ItemsShow />} />
          <Route path="men" key={'men'} element={<ItemsShow />} />
          <Route path="kids" key={'kids'} element={<ItemsShow />} />
          <Route path="perfume" key={'perfume'} element={<ItemsShow />} />

          {/* <Route path="contact" key={'contact'} element={<ItemShow />} /> */}

          <Route path="login" key={'login'} element={<Login />} />
          <Route path="signup" key={'signup'} element={<Signup/>} />

          {/* <Route path="*" element={<ItemShow />} /> */}
        </Routes>
    </>
  );
}

export default App;
